import React, {Component} from 'react';

import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Image from 'react-bootstrap/Image';

import './css/FrontPage.css';

class FrontPage extends Component {
  render(){
    return(
      <div>
        <div className="lineargradientrainbow135 fpcontainer">
          <h1 className="align-item-center">
            Club Name
          </h1>
        </div>

        <div className="fpcontainer">
          <Container fluid className="align-item-center">
            <Row className="justify-content-center">
              <Col xs={12}>
                <Image src="imgs/people_stock_img.jpeg" />
              </Col>
              <Col xs={12}>
                Some random info
              </Col>
            </Row>
            <Row className="justify-content-md-center">
              <Col xs={12} sm={6}>
                some more info
              </Col>
              <Col xs={12} sm={6}>
               <Image src="imgs/people_stock_img.jpeg" />
              </Col>
            </Row>
          </Container>
        </div>

        <div className="lineargradientrainbow45 fpcontainer">

        </div>
      </div>
    );
  }
}

export default FrontPage;
